  \"2016-07-27T22:41:48.577050\",\n\t\"name\": \"completion-report-of-contaminant-analyses-for-the-level-ii-study-at-overflow-national-wild\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Fish Tissue Samples Only the piscivorous/omnivorous
  fish (Table 1) from the off refuge site (OV-20) had an average mercury concentration
  that exceeded the EPA recommended level of 1.0 ppm for fillets (EPA 1989). Concentrations
  of mercury in whole body samples would range from half to equal the concentrations
  found in fillets (Wiener 1988). Therefore, the average level of mercury in fillets
  at OV-20 may be higher than the 1.4 ppm found in this whole body sample. The other
  fish tissue samples, which were collected from sites within the refuge, contained
  lower concentrations of mercury. Average concentrations of selenium in the fish
  tissue samples (Table 1) were all less than the EPA recommended level of 5.4 ppm
  for fish fillets (EPA 1989). Sediment Samples Mercury concentrations in sediment
  samples ranged from .02 to .06 ppm (Table 2). As mentioned in the level II report,
  background levels for mercury in soils from the United States ranged from .02 to
  .11 ppm in uncontaminated areas of the north central U.S. up to 4.1 ppm in contaminated
  sites. However, with a bioconcentration factor of 5,000 for mercury, concentrations
  in sediments in or near the NWR may bioaccumulate to levels of concern in biota.
  None of the sediment samples from on or near the NWR had selenium concentrations
  that approached the 1.0 ppm level which the Wisconsin Department of Natural Resources
  (DNR) considers safe for open water dumping (Wisconsin DNR 1985).\",\n\t\"license_title\":
